// ArticleList.jsx
import React from "react";
import "./ArticleList.css";

const ArticleList = ({ articles }) => {
  return (
    <div className="article-list">
      <h2>Articles List</h2>
      <ul>
        {articles.map((article, index) => (
          <li key={index}>{article.title}</li>
        ))}
      </ul>
    </div>
  );
};

export default ArticleList;
